import React, { Component } from "react";
export default class Seventh extends Component {
  render() {
    return (
      <section id="seventh">
        <div class="row">
          <div class="column01">
            <p className="lead">Monitoring</p>
            <h4 className="end">
              It is suggested that you reach out for help if you are using the
              USIAM app for a monitoring tool. You simply add a monitor's secure
              email address and they will receive a copy of your daily entries.
              Many therapists and coaches have used the USEIAM app with
              successfull outcomes.
            </h4>
          </div>
          <div class="column02">
            <img class="ios-pic" src="images/logged.png" alt="" />
          </div>
        </div>
      </section>
    );
  }
}
